import React, { useState } from 'react';
import './style.css';


const SWOT = () => {
  const [strengths1, setStrengths1] = useState([
    '기술적인 능력',
    '문제 해결 능력',
    '변화에 빠른 적응'
  ]);
  const [weaknesses1, setWeaknesses1] = useState([
    '커뮤니케이션 능력 부족',
    '시간 관리 어려움',
  ]);
  const [opportunities1, setOpportunities1] = useState([
    '신기술의 도입으로 성장 가능성',
    '프로젝트 경험을 통한 역량 강화',
    '창의적인 아이디어의 구현 기회'
  ]);
  const [threats1, setThreats1] = useState([
    '경쟁력 강한 시장',
    '기술 발전에 따른 역량 요구 증가',
    '프로젝트 일정과의 압박'
  ]);

  const [strengths2, setStrengths2] = useState([
    '빠른 학습 능력',
    '문제 해결에 대한 창의성',
    '팀워크와 협업 능력'
  ]);
  const [weaknesses2, setWeaknesses2] = useState([
    '커뮤니케이션 능력 부족',
    '시간 관리 어려움',
  ]);
  const [opportunities2, setOpportunities2] = useState([
    '신기술의 도입으로 성장 가능성',
    '다양한 프로젝트 경험 기회',
    '글로벌 시장 확장 가능성'
  ]);
  const [threats2, setThreats2] = useState([
    '경쟁력 강한 시장',
    '기술 발전에 따른 역량 요구 증가',
    '프로젝트 일정과의 압박'
  ]);

  return (
    <div>
      <div className="swot-container">
        <h1 className="swot-title" style={{color:"white"}}>웹개발 SWOT 분석</h1>
        <div className="swot-grid">
          <div className="swot-card swot-strengths">
            {/* 장점 */}
            <h2 className="swot-card-title">Strengths</h2>
            <ul className="swot-card-list">
              {strengths1.map((strength, index) => (
                <li className="swot-card-item" key={index}>
                  {strength}
                </li>
              ))}
            </ul>
          </div>
          <div className="swot-card swot-weaknesses">
            {/* 약점 */}
            <h2 className="swot-card-title">Weaknesses</h2>
            <ul className="swot-card-list">
              {weaknesses1.map((weakness, index) => (
                <li className="swot-card-item" key={index}>
                  {weakness}
                </li>
              ))}
            </ul>
          </div>
          <div className="swot-card swot-opportunities">
            {/* 기회 */}
            <h2 className="swot-card-title">Opportunities</h2>
            <ul className="swot-card-list">
              {opportunities1.map((opportunity, index) => (
                <li className="swot-card-item" key={index}>
                  {opportunity}
                </li>
              ))}
            </ul>
          </div>
          <div className="swot-card swot-threats">
            {/* 위협 */}
            <h2 className="swot-card-title">Threats</h2>
            <ul className="swot-card-list">
              {threats1.map((threat, index) => (
                <li className="swot-card-item" key={index}>
                  {threat}
                </li>
              ))}
            </ul>
          </div>
        </div>
      </div>

    </div>
  );
};

export default SWOT;
